import React from 'react';

const BottomNavigation = () => {
  return (
    <nav className="bottom-nav">
      <ul>
      <nav className="p-4 ">
        <button className="border rounded-lg text-black px-4 py-2 mr-2 hover:bg-gray-00">Streaming</button>
        <button className="border rounded-lg text-black px-4 py-2 mr-2 hover:bg-gray-200">Genre</button>
        <button className="border rounded-lg text-black px-4 py-2 mr-2 hover:bg-gray-200">Batch</button>
      </nav>
      </ul>
    </nav>
  );
};

export default BottomNavigation;
